import Proptypes from "prop-types";
import styled from "styled-components";
import Link from "next/link";
import { Menu, Row, Col } from "antd";

const AppLayout = ({ children }) => {
  return (
    <div>
      {/* <Menu mode="horizontal">
        <Menu.Item key="home">
          <Link href={"/"}>
            <a>홈페이지</a>
          </Link>
        </Menu.Item>
        <Menu.Item key="notice">
          <Link href={"/notice"}>
            <a>공지사항</a>
          </Link>
        </Menu.Item>
        <Menu.Item key="reservation">
          <Link href={"/reservation"}>
            <a>예약 페이지</a>
          </Link>
        </Menu.Item>
      </Menu> */}
      <HeaderBox>
        <Logo>Pul,inn</Logo>
        <div>
          <Link href={"/"}>
            <a>홈페이지</a>
          </Link>
          <Link href={"/notice"}>
            <a>공지사항</a>
          </Link>
          <Link href={"/reservation"}>
            <a>예약 페이지</a>
          </Link>
        </div>
      </HeaderBox>
      <Row gutter={8}>
        <Col xs={24} md={6}>
          왼쪽 메뉴
        </Col>
        <Col xs={24} md={12}>
          {children}
        </Col>
        <Col xs={24} md={6}>
          <a
            href="https://www.airbnb.co.kr/rooms/52211363?adults=1&s=42&unique_share_id=F7A5497F-8FB2-469B-B5E3-38729118B76B&_branch_match_id=1052844957711407821&_branch_referrer=H4sIAAAAAAAAA8soKSkottLXT0zKS9LLTdX3KwpN9TQyy%2FTKTwIAYiyBlhsAAAA%3D&source_impression_id=p3_1652340475_8t%2FwfEaVNoa3GFFj"
            target="_blank"
            rel="noreferrer noopener"
          >
            에어비앤비 링크
          </a>
        </Col>
      </Row>
    </div>
  );
};

const HeaderBox = styled.div`
  width: 100%;
  height: 200px;
  border: 1px black solid;
`;

const Logo = styled.h1`
  font-size: 68px;
  line-height: 200px;
`;

const NavBox = styled.div`
  border: 1px red solid;
`;

AppLayout.propTypes = {
  children: Proptypes.node.isRequired,
};

export default AppLayout;
